commits.content:
import Wrapper from '../assets/wrappers/StatItem';
const StatItem = ({ count, title, icon, color, bcg }) => {
  return (
    <Wrapper>
      <header>
        <span className='count'>{count}</span>
        <span className='icon'>{icon}</span>
      </header>
      <h5 className='count'>{title}</h5>
    </Wrapper>
  );
};
export default StatItem;
